import React from 'react';

const Disperse = () => {
  return (
    <div style={{ width: "100%", height: "100vh", backgroundColor: 'whitesmoke', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
      <div style={{ width: "90%", height: "90%", backgroundColor: "white" ,display: 'flex', justifyContent: 'center', alignItems: 'center'}}>
        <div style={{width:"50%",height:"50%",padding:"3vw"}}>
          <h4 >Addresses with Amounts</h4>

          <textarea cols={5} style={{ width: '100%', height: "80%", display: "block" }}></textarea>
          <button style={{width:"101%",display:"flex", textAlign:"center"}}>Submit</button>

        </div>
      </div>
    </div>
  )
}

export default Disperse;
